  false,\n\t\"url\": null,\n\t\"notes\": \"The Bar Harbor, Maine Forecast Model Grids
  provides bathymetric data strictly for tsunami inundation modeling with the Method
  of Splitting Tsunami (MOST) model. MOST is a suite of numerical simulation codes
  capable of simulating three processes of tsunami evolution: generation, transoceanic
  propagation, and inundation of dry land. Tsunami waves are computationally propagated
  across a set of three nested grids (A, B, and C), each of which is successively
  finer in resolution, moving from offshore to onshore. Nearshore details are resolved
  to the point that model output can be directly compared with tide gauge observations
  and can provide estimates of wave arrival time, wave amplitude and simulation of
  wave inundation onto dry land. A Grid Resolution: 30 arc-sec. B Grid Resolution:
  12 arc-sec in the x direction. 9 arc-sec in the y direction. C Grid Resolution:
  2 arc-sec.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
